function levenshteinDistance(str1, str2) {
  const m = str1.length;
  const n = str2.length;
  const dp = Array(m + 1).fill().map(() => Array(n + 1).fill(0));

  for (let i = 0; i <= m; i++) {
    dp[i][0] = i;
  }

  for (let j = 0; j <= n; j++) {
    dp[0][j] = j;
  }

  for (let i = 1; i <= m; i++) {
    for (let j = 1; j <= n; j++) {
      if (str1[i - 1] === str2[j - 1]) {
        dp[i][j] = dp[i - 1][j - 1];
      } else {
        dp[i][j] = 1 + Math.min(
          dp[i - 1][j],     // deletion
          dp[i][j - 1],     // insertion
          dp[i - 1][j - 1]  // substitution
        );
      }
    }
  }

  return dp[m][n];
}

const expected_code = $('When Executed by Another Workflow').first().json.Cor.toUpperCase()

let maxScore = 0;
let chosenItem;

$input.first().json.payload.forEach((item) => {
  let dist = levenshteinDistance(
    expected_code, 
    item.name
  )

  let max_dist = Math.max(
    expected_code.length,
    item.name.length
  )

  let score = 1 - (dist / max_dist)
  //console.log("score for " + item.name + " is " + score)
  if (score > maxScore){
    maxScore = score
    chosenItem = item
  }
});

return { 'json' : { cor: chosenItem } };
